import Axios from "axios";

function Checkroute(props) {
  //const { code } = props;

  const baseurl = "http://localhost";
  const port = ":3001";
  const shortcode = props.match.params.code;

  Axios.get(baseurl + port + "/geturl/" + shortcode)
    .then((response) => {
      console.log(response.data);
      if (response.data.length > 0) {
        props.history.push("/geturl/" + shortcode);
      } else {
        console.log("no data");
        //props.history.push("/page/404");
      }
    })
    .catch((error) => {
      console.log(error);
    });

  return <div className="cotainer"></div>;
}

export default Checkroute;
